import logo from './logo.svg';
import './App.css';
import FirstComponent from './FirstComponent'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
        </p>
        <a>
        </a>
      </header>
      <FirstComponent displaytext="First Component Data"/>
    </div>
  );
}

export default App;
